##########返回yyyymmddhhmmss
def datetime_def():
    return datetime.now().strftime("%Y%m%d%H%M%S")


##########返回yyyy-mm-dd hh:mm:ss
def datetime_format_def():
    timetemp = datetime.now()
    return datetime.now().strftime("%Y-%m-%d %H:%M:%S")


##########返回yyyymmddhhmmss
def datetime_add_def(_second):
    timetemp=datetime.now()
    timetemp1 = timetemp + timedelta(seconds=_second)
    return timetemp1.strftime("%Y%m%d%H%M%S")


##########返回%Y-%m-%d %H:%M:%S
def datetime_add_format_def(_second):
    timetemp = datetime.now()
    timetemp1 = timetemp + timedelta(seconds=_second)
    return timetemp1.strftime("%Y-%m-%d %H:%M:%S")


##########返回yyyymmddhhmmss
def datetime_reduce_def(_second):
    timetemp=datetime.now()
    timetemp1 = timetemp - timedelta(seconds=_second)
    return timetemp1.strftime("%Y%m%d%H%M%S")
    # minutes

##########返回%Y-%m-%d %H:%M:%S
def datetime_reduce_format_def(_second):
    timetemp = datetime.now()
    timetemp1 = timetemp - timedelta(seconds=_second)
    return timetemp1.strftime("%Y-%m-%d %H:%M:%S")


##########返回yyyymmddhhmmss
def datetime_reduce1_def(_timetemp, _second):
    timetemp1 = _timetemp - timedelta(seconds=_second)
    return timetemp1.strftime("%Y%m%d%H%M%S")


##########把base64格式转回图片保存
def base64_picture_def(_qr):
    imgdata = base64.b64decode(_qr + "==")
    file = open('.//image//qr.jpg','wb')
    file.write(imgdata)
    file.close()
    print("保存qr.jpg图片成功")


##########组字符串进行md5加密
def  add_sign_md5(_parm):
    private_key = "711fddf25debe85cfd394a0ed4a28e20"
    l_parm=""
    #组字符串
    for p in sorted(_parm):
        l_parm =  l_parm + str(_parm[p])
    l_signparm = l_parm + private_key

    #md5加密
    str_md5 = hashlib.md5(l_signparm.encode(encoding='utf-8')).hexdigest()
    return str_md5.upper()


##########获取station.xml里的线路和站点
def get_station_data():
    xmlfile_path = "./file/station.xml"
    tree = ET.parse(xmlfile_path)
    root = tree.getroot()

    line_a =root.find("LineBaseInfo")  #find只匹配一个

    line_sta_name = {}
    station_lin=[]
    for ele  in line_a.findall("BasicInfo"):
        for stationid in ele.findall("StationList"):

            station_lin.append(stationid.attrib["StationBaseId"])

        line_sta_name[ele.attrib['Name']] = station_lin
        station_lin = []

    station_a = root.find("StationBaseInfo")

    station_in_name ={}
    for i in station_a.findall("BasicInfo"):
        station_in_name[i.attrib["Id"]] = i.attrib["Name"]

    line_stationname = {}
    list_content_value = []
    for key,k in line_sta_name.items():
        for value in k:
            list_content_value.append( station_in_name[value])
        line_stationname[key]=list_content_value
        list_content_value=[]

    return  line_stationname,line_sta_name


